import React from "react";
import './app.css';
import {Route, Link, Switch} from 'react-router-dom';
import Taco from './components/taco/Taco';
import Nav from './components/nav/Nav';

const App = () => {
  return (
    <div>
      <Nav />
      <Switch>
        <Route path='/' >
          
        </Route>
        <Route path='/order' >
          <Taco />
        </Route>
      </Switch>
    </div>
  );
};
export default App;
